import React from "react";
import {
  StyleSheet,
  Text,
  View,
  Image,
  TouchableOpacity,
  ImageBackground,
  FlatList,
} from "react-native";
import { AntDesign, FontAwesome5 } from "@expo/vector-icons";
import TransparentHeader from "../components/TransparentHeader";
import { LinearGradient } from "expo-linear-gradient";

const ElevenScreen = ({ navigation }) => {
  const DATA = [
    {
      title: "كابوريا",
      imageUrl:
        "https://upload.wikimedia.org/wikipedia/commons/1/12/Liocarcinus_vernalis.jpg",
      color: "orange",
    },
    {
      title: "استاكوزا",

      imageUrl:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQYaXcdJX2V_zyBlKrt_AJYWQzWM8VpIHNN1Q&usqp=CAU",
      color: "red",
    },
    {
      title: "سمك سردين",

      imageUrl:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSZsdwN7iyh2jjJOAxxwCI1wzTttUhfFMtdaA&usqp=CAU",
      color: "green",
    },

    {
      title: "جمبري",
      imageUrl:
        "https://snappygoat.com/b/fbf29a74883b71582001fd8fb889c92cbd1e017a",
      color: "orange",
    },
    {
      title: "كابوريا",
      imageUrl:
        "https://upload.wikimedia.org/wikipedia/commons/1/12/Liocarcinus_vernalis.jpg",
      color: "orange",
    },
    {
      title: "استاكوزا",
      imageUrl:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQYaXcdJX2V_zyBlKrt_AJYWQzWM8VpIHNN1Q&usqp=CAU",
      color: "red",
    },
  ];
  return (
    <View style={{ flex: 1 }}>
      <View
        style={{
          borderBottomLeftRadius: 10,
          borderBottomRightRadius: 10,
          borderWidth: 0.5,
          height: "25%",
          backgroundColor: "#2B4074",
        }}
      >
        <ImageBackground
          style={{
            width: "100%",
            //height: "100%",
            alignSelf: "center",
          }}
          resizeMode="cover"
          source={{
            uri:
              "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSLHNbuk3FMW4fuR5NetfJY0gxMlqiDo8q5Yw&usqp=CAU",
          }}
        >
          <TransparentHeader />
        </ImageBackground>
      </View>
      <View style={styles.ButtonWrapper}>
        <TouchableOpacity
          style={{ width: "40%" }}
          onPress={() => navigation.navigate("Twelve")}
        >
          <LinearGradient
            style={{ ...styles.Button, width: "100%" }}
            colors={["#DE2E3B", "#E64440", "#EF5F46"]}
          >
            <Text style={styles.BtnText}>العروض</Text>
            <View
              style={{
                width: 33,
                height: 33,
                justifyContent: "center",
                alignItems: "center",
                borderRadius: 33 / 2,
                borderWidth: 1.4,
                border: "solid red",
                borderColor: "#fff",
              }}
            >
              <Text
                style={{
                  color: "rgba(0,0,0,0.4)",
                  fontSize: 22,
                  color: "#fff",
                }}
              >
                <FontAwesome5 name="percent" size={17} color="#fff" />
              </Text>
            </View>
          </LinearGradient>
        </TouchableOpacity>
        <TouchableOpacity style={{ width: "40%" }}>
          <LinearGradient
            colors={["#DE2E3B", "#E64440", "#EF5F46"]}
            style={{ ...styles.Button, width: "100%" }}
          >
            <Text style={styles.BtnText}>المفضلة</Text>
            <AntDesign name="hearto" size={30} color="#fff" />
          </LinearGradient>
        </TouchableOpacity>
      </View>
      <View style={styles.LargeBtnWrapper}>
        <FlatList
          numColumns={2}
          columnWrapperStyle={{ justifyContent: "space-evenly" }}
          keyExtractor={(item, index) => index.toString()}
          data={DATA}
          renderItem={({ item, index }) => {
            return (
              <View style={styles.LargeBtn}>
                <Image
                  style={{
                    width: "100%",
                    height: 120,
                    resizeMode: "cover",
                  }}
                  source={{ uri: item.imageUrl }}
                />
                <View style={{ backgroundColor: item.color, width: "100%" }}>
                  <Text
                    style={{
                      fontSize: 15,
                      color: "white",
                      alignSelf: "center",
                      //   marginRight: 5,
                    }}
                  >
                    {item.title}
                  </Text>
                </View>
              </View>
            );
          }}
        />
      </View>
      {/* </ImageBackground> */}
    </View>
  );
};

export default ElevenScreen;

const styles = StyleSheet.create({
  ButtonWrapper: {
    width: "100%",
    alignItems: "center",
    flexDirection: "row",
    justifyContent: "space-around",
    marginTop: 20,
  },
  Button: {
    paddingVertical: 20,
    justifyContent: "space-around",
    alignItems: "center",
    flexDirection: "row",
    borderRadius: 40,
    paddingHorizontal: 20,
  },
  BtnText: {
    fontSize: 27,
    color: "#fff",
  },
  LargeBtnWrapper: {
    flex: 1,
    alignSelf: "center",
    width: "100%",

    marginTop: 20,
  },
  LargeBtn: {
    minHeight: 100,
    width: "40%",
    marginBottom: 20,
    //backgroundColor: "transparent",
    //backgroundColor: "yellow",
    borderRadius: 10,
    elevation: 12,
    shadowOffset: { width: 4, height: 5 },
    shadowOpacity: 0.3,
    shadowRadius: 5,
    alignItems: "center",
    justifyContent: "center",
  },
});
